# Largest 1-Bordered Square
from typing import List
import time

class Solution:
    def largest1BorderedSquare(self, grid: List[List[int]]) -> int:
        n, m = len(grid), len(grid[0])
        if not any(1 in xs for xs in grid): return 0
        maxL = min(n, m)
        minL = 0
        for i, row in enumerate(grid):
            for j, n in enumerate(row):
                if n != 1: continue
                tmp = minL
                for k in range(maxL - 1, tmp, -1):
                    try:
                        if grid[i + k][j + k] == 1 and grid[i + k][j] == 1 and grid[i][j + k] == 1:
                            flag = True
                            for h in range(1, k):
                                if grid[i][j + h] != 1 or grid[i + k][j + h] != 1:
                                    flag = False
                                    break
                            if not flag: continue
                            for v in range(1, k):
                                if grid[i + v][j] != 1 or grid[i + v][j + k] != 1:
                                    flag = False
                                    break
                            if flag:
                                minL = k
                                break
                    except Exception:
                        continue
        return (minL + 1) * (minL + 1)

